import React, { useState } from "react";

const Count = () => {
  const [count, setcount] = useState(0);

  const IncNum = () => {
    return setcount(count + 1);
  };
  const DecNum = () => {
    return setcount(count - 1);
  };
  return (
    <>
      <h1>{count}</h1>
      <button onClick={IncNum}> + </button> &emsp
      <button onClick={DecNum}> - </button>
    </>
  );
};

export default Count;
